import { ThemeProvider } from 'emotion-theming'
import theme from '../theme/theme.js'





function MyApp({ Component, pageProps}) {




	return (
        <>
            <ThemeProvider theme={theme}>


				< Component {...pageProps} />


            </ThemeProvider>
        </>
    )

};



export default MyApp
